\f0\fs15 \cf0 FlyMine is an integrated database of genomic, expression and protein data from 
\i Drosophila
\i0 , 
\i Anopheles
\i0  and other insects. As an integrated resource it is possible to run data mining queries that span domains of biological knowledge. Inclusion of InParanoid orthologues allows comparative analysis between organisms.}

